text:
vakuutan sitoutuvani seuraaviin toimiin, jos tulen valituksi euroopan parlamenttiin vaalikaudelle 2019-2024: • aktiivisesti torjua, estää ja ilmiantaa seksismiä sekä seksuaalista häirintää ja olla vaikenematta sekä hyväksymättä minkäänlaisia oikeutuksia kyseisen kaltaiselle toiminnalle;
• lopettaa vaikenemisen kulttuurin ja vallitsevan taipumuksen syyttää seksuaalisen häirinnän uhreja tekijöiden sijaan;
• olla ikinä hyväksymättä immuniteettia rankaisemattomuuden syyksi ja varmistaa ennaltaehkäisevät sanktiot seksuaalisen häirinnän toteuttamiselle;
• osallistua parlamentin kunnioitusta ja arvokkuutta edistävään koulutukseen ja myötävaikuttaa sen pakollisuuteen kaikille mepeille ja muulle henkilökunnalle;
• taistella saavutettavan, tehokkaan ja täysin itsenäisen rakenteen luomiseksi, millä puututaan häirintään euroopan parlamentissa
• aktiivisesti suojella kaikkia euroopan parlamentin työntekijöitä, ja erityisesti epävarmassa työsuhteessa olevia;
• tukea eu:n seksuaalista häirintää ja hyväksikäyttöä vastustavan päätöslauselman (p8 ta(2017)0402) täytääntöönpanoa, vahvaa sosiaalisen sukupuolen toimintasuunnitelman luomista ja naisiin kohdistuvan väkivallan vastaista eu-direktiiviä;
• edistää ymmärrystä siitä, että sukupuolten välinen tasa-arvo koskee kaikkia, ei vain naisia;
• taata, että euroopan parlamentti antaa esimerkin olemalla edelläkävijä seksuaalista häirintää estävien ja turvallisen työympäristön takaavien standardien asettajana
• tehdä tunnetuksi ja tukea kaikkien hyväksi havaittujen eu-tason käytänteiden täytäntöönpanoa kansallisissa parlamenteissa ja omassa puolueessaan;
#metooep #metoo

