plus que 3 jours pour pré-commander et/ou faire connaître ce numéro spécial féminin de "orbs, l'autre planète"  qui trace entre autres 20 sujets passionnants, la longue route de la reconnaissance des femmes réalisatrices, des pionnieres comme alice guy-blaché au mouvement @timesupnow, en passant par le weekend des 100 femmes de l'hôtel miramar et le @metoomvmt de @taranajaneen jusqu'à la déferlante 2017 du hashtag #metoo déclenchée par l'actrice @milano_alyssa.

